document.getElementById("loginForm").addEventListener("submit", function(e) {
  e.preventDefault();
  var pw = document.getElementById("pw").value;
  if (!pw) return;
  document.getElementById("error").style.display = "none";
  document.getElementById("loading").style.display = "block";
  setTimeout(function() {
    try {
      var raw = CryptoJS.enc.Base64.parse(ED);
      var wa = raw;
      var bytes = new Uint8Array(wa.sigBytes);
      for (var i = 0; i < wa.sigBytes; i++) bytes[i] = (wa.words[i >>> 2] >>> (24 - (i % 4) * 8)) & 0xff;
      var saltWA = CryptoJS.lib.WordArray.create(bytes.slice(0, 16));
      var ivWA = CryptoJS.lib.WordArray.create(bytes.slice(16, 32));
      var ctWA = CryptoJS.lib.WordArray.create(bytes.slice(32));
      var k = CryptoJS.PBKDF2(pw, saltWA, {keySize:8, iterations:100000, hasher:CryptoJS.algo.SHA256});
      var dec = CryptoJS.AES.decrypt({ciphertext:ctWA}, k, {iv:ivWA, mode:CryptoJS.mode.CBC, padding:CryptoJS.pad.Pkcs7});
      var txt = dec.toString(CryptoJS.enc.Utf8);
      if (txt && txt.length > 100 && txt.indexOf("<" + "!DOCTYPE") !== -1) {
        var iframe = document.createElement("iframe");
        iframe.style.cssText = "position:fixed;top:0;left:0;width:100%;height:100%;border:none;margin:0;padding:0;z-index:9999;background:#0a0a0a;";
        document.body.innerHTML = "";
        document.body.style.margin = "0";
        document.body.style.padding = "0";
        document.body.style.overflow = "hidden";
        document.body.appendChild(iframe);
        var d = iframe.contentDocument || iframe.contentWindow.document;
        d.open();
        d.write(txt);
        d.close();
      } else {
        document.getElementById("loading").style.display = "none";
        document.getElementById("error").style.display = "block";
        document.getElementById("pw").value = "";
      }
    } catch(err) {
      console.error("Decrypt error:", err);
      document.getElementById("loading").style.display = "none";
      document.getElementById("error").style.display = "block";
      document.getElementById("pw").value = "";
    }
  }, 100);
});
</script>
